import React, { useState } from 'react';
import SearchModal from './FilterModal';

const SearchBar = ({ onSearch, compact = false }) => {
    const [showModal, setShowModal] = useState(false);
    const [filters, setFilters] = useState({
        location: '',
        city: '',
        property_type: '',
        agent_id: ''
    });

    // For mobile: show as compact bar that opens modal
    if (window.innerWidth < 768 || compact) {
        return (
            <>
                <div 
                    className="search-bar-compact shadow-sm cursor-pointer"
                    onClick={() => setShowModal(true)}
                >
                    <div className="d-flex align-items-center justify-content-between">
                        <div className="d-flex align-items-center gap-3">
                            <i className="bi bi-search"></i>
                            <div>
                                <div className="fw-semibold">Search destinations</div>
                                <div className="text-muted small">
                                    {filters.city || 'Anywhere'} Â· {filters.property_type || 'Any type'}
                                </div>
                            </div>
                        </div>
                        <i className="bi bi-funnel"></i>
                    </div>
                </div>

                {/* Search Modal - Mobile */}
                <SearchModal 
                    show={showModal}
                    onHide={() => setShowModal(false)}
                    filters={filters}
                    setFilters={setFilters}
                    onSearch={onSearch}
                />
            </>
        );
    }

    // Desktop: horizontal search bar
    return (
        <div className="search-bar-desktop d-flex align-items-center">
            {/* Where */}
            <div className="search-section flex-grow-1">
                <label className="form-label text-dark fw-semibold mb-1">
                    Where
                </label>
                <input
                    type="text"
                    className="form-control"
                    placeholder="Search destinations"
                    value={filters.location}
                    onChange={(e) => setFilters({...filters, location: e.target.value})}
                />
            </div>

            {/* City Filter */}
            <div className="search-section flex-grow-1">
                <label className="form-label text-dark fw-semibold mb-1">
                    City
                </label>
                <select 
                    className="form-select"
                    value={filters.city}
                    onChange={(e) => setFilters({...filters, city: e.target.value})}
                >
                    <option value="">All cities</option>
                    <option value="Mumbai">Mumbai</option>
                    <option value="Delhi">Delhi</option>
                    <option value="Bangalore">Bangalore</option>
                    <option value="Goa">Goa</option>
                    <option value="Pune">Pune</option>
                </select>
            </div>

            {/* Property Type */}
            <div className="search-section flex-grow-1">
                <label className="form-label text-dark fw-semibold mb-1">
                    Type
                </label>
                <select 
                    className="form-select"
                    value={filters.property_type}
                    onChange={(e) => setFilters({...filters, property_type: e.target.value})}
                >
                    <option value="">Any type</option>
                    <option value="apartment">Apartment</option>
                    <option value="house">House</option>
                    <option value="villa">Villa</option>
                    <option value="studio">Studio</option>
                </select>
            </div>

            {/* Search Button */}
            <div className="px-3">
                <button 
                    className="btn btn-danger rounded-circle d-flex align-items-center justify-content-center"
                    onClick={() => onSearch(filters)}
                >
                    <i className="bi bi-search text-white"></i>
                </button>
            </div>
        </div>
    );
};

export default SearchBar;
